Figure 1a shows the UV–Vis absorption spectra of the CCPICPB dye in THF solution, and Table 1 lists the relevant outcomes. Two notable bands were seen in the UV–Vis spectra of solution: one at around 300 nm and the other at 634 nm. The former is explained by the π–π* transitions resulting from the conjugation of the multiple aromatic rings. The intramolecular charge transfer (ICT) transition from the carbazole donor groups to the azadipyrro cores linked to the acid acceptor unit may be responsible for the absorption band at 634 nm. The absorption spectra of the dye anchored on TiO2 film was also examined in order to observe the spectral response upon sensitization. Its absorption curves broaden significantly in contrast to the absorption spectra of CCPICPB in THF (Fig. 1b). CCPICPB's spectral response increased till 850 nm. Additionally, compared to those in the solution state, their absorption peaks were red-shifted; CCPICPB had a significant absorption peak at 648 nm, which should be due to the J-aggregation effect. The red-shift of absorption maxima around 14 nm is also attributed to the deprotonation of the acid group and the charge transfer transitions [71–73].Figure 1
